(127, 'Java Programming', 'WPvGqX-TXP0', 'Cheat Sheet is Here : http://goo.gl/OPMjte\n\nSlower Java Tutorial : http://goo.gl/UHdlyP\n\nHow to Install Java & Eclipse : http://goo.gl/vEEEJE\n\nBest Java Book : http://goo.gl/FtKp0m\n\nSupport Me on Patreon : https://www.patreon.com/derekbanas\n\nIn this Java programming Tutorial I''ll teach you all of the core knowledge needed to write Java code in 30 minutes. This is the most popular request from everyone.\n\nI specifically cover the following topics: primitive data types, comments, class, import, Scanner, final, Strings, static, private, protected, public, constructors, math, hasNextLine, nextLine, getters, setters, method overloading, Random, casting, toString, conversion from Strings to primitives, converting from primitives to Strings, if, else, else if, print, println, printf, logical operators, comparison operators, ternary operator, switch, for, while, break, continue, do while, polymorphism, arrays, for each, multidimensional arrays and more.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/WPvGqX-TXP0" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=WPvGqX-TXP0', 'javaJava programming TutorialJavaJava TutorialJava Video TutorialLearn JavaJava (Software)Tutorial (Industry)', '2016-06-05', '2016-06-05'),
(128, 'Java Programming - Step by Step tutorial', '3u1fu6f8Hto', 'Easy to follow step by step Java programming tutorial.\nBuy the full 4 hour video at http://www.patrickvideos.com. \nThe direct download link at https://gumroad.com/l/WloP\n\nIn 4 hrs you will learn all the important concepts of Java, each explained using small simple programs. The teaching method used, will be the easiest way to learn Java, that you will ever find.\n\nReproducing the previously top  rated comment and my reply to it. This shows the exact advantage of my video. \nFrom weefunkster: \nIncredible pace and excellent learning structure. I bit the bullet and payed for the full course and I have no regrets whatsoever. The price would be worth it for the editing alone, I can''t tell you how bad it is for a learner to hear the instruction''s then have to wait for the instructor to type the code before getting an explanation. I didn''t realize it was so bad until I watched this and I wondered why my mind wondered all over the place and I didn''t learn a thing. Truly Brilliant\n\nMy Reply: \nThank You! I am so so happy that at-last someone realized the effort that went into editing and the true advantage of the video. People write and ask how can someone learn Java in 4 hrs? This is not a 4 hr class, but a full 5 day(40 hrs) class. Edited so tight(No err, uhh, sometimes I edited out even the time between the words) that what resulted is a 4hr video. Even I was shocked at so few hours!', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/3u1fu6f8Hto" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=3u1fu6f8Hto', 'Tutorial (Industry)Java Programming TutorialAP Computer Science A examJava in 4hrsJava (programming Language)Java (software Platform)Computer Science (Game)Software Tutorial', '2016-06-05', '2016-06-05'),
