(139, 'Being Epic: Best Practices for Android Development', '', 'Turn good ideas into great apps by following some essential Android development best practices. Starting with an overview of the 5 deadly sins and 5 golden rules, you will learn how to build apps that users love and that are good citizens of the mobile environment. You will also learn specific best practices for background apps and location based services.', 0, '<iframe src="https://www.slideshare.net/slideshow/embed_code/key/39sI9psu2fPcog" width="427" height="356" frameborder="0" marginwidth="0" marginheight="0" scrolling="no" style="border:1px solid #CCC; border-width:1px; margin-bottom:5px; max-width: 100%;" allowfullscreen> </iframe> \n\n', 0, 0, '', 'Being Epic: Best Practices for Android Development', '2016-06-05', '2016-06-05'),
