(141, 'Designing for diversity -  how to stop worrying and embrace the Android revolution', '', 'It took 16 years for smartphone penetration to reach 1 billion people. Analysts believe it will take only 3 years to reach the next billion. The devices these consumers buy will be incredibly diverse, yet many will run on Android; a platform that now sees more than 1.5 million activations per day.\n\n\nIn this presentation, we explore the fascinating rise of Android around the globe. From dual SIM phones in Indonesia, to dual screen e-ink devices in Russia and crowd-sourced platform modifications in China, we will discover the role open source has played in Android&rsquo;s popularity and how to design for such a diverse environment. ', 0, '<iframe src="https://www.slideshare.net/slideshow/embed_code/key/ZeKgnppCAZoyt" width="427" height="356" frameborder="0" marginwidth="0" marginheight="0" scrolling="no" style="border:1px solid #CCC; border-width:1px; margin-bottom:5px; max-width: 100%;" allowfullscreen> </iframe> \n\n', 0, 0, '', 'Designing for diversity -  how to stop worrying and embrace the Android revolution', '2016-06-05', '2016-06-05'),
