(151, 'Android vs iPhone - Differences in UI Patterns and Design', '', 'While using Android over the past couple of weeks i’ve noticed some things when comparing my top apps to iOS. Both iOS and Android, in different cases, choose different UI elements to do different things. I wanted to catalog some of them here.\n\nOverall I’d say that mainstream Android apps have improved over time, and in many cases (Spotify, Evernote, NPR, and Amazon) I liked the Android versions better. Also with design trends moving to blocky designs and flat colors (like Windows 8) - Android looks more modern in a side-by-side comparison to its iOS counterpart.\n\nIf anything this shows that there are very few standard patterns that are used 100% of the time on each OS, but there is risk of confusion from someone expecting one thing - like they have an iPad tablet, but an Android phone - and getting different results when switching between devices.', 0, '<iframe src="https://www.slideshare.net/slideshow/embed_code/key/Fm1GJHq1rWorEf" width="427" height="356" frameborder="0" marginwidth="0" marginheight="0" scrolling="no" style="border:1px solid #CCC; border-width:1px; margin-bottom:5px; max-width: 100%;" allowfullscreen> </iframe> \n\n', 0, 0, '', 'Android vs iPhone - Differences in UI Patterns and Design', '2016-06-05', '2016-06-05'),
