(162, 'Learn HTML in 12 Minutes', 'bWPMSSsVdPk', 'In this short HTML tutorial, I explain the basic structure of an HTML webpage and introduce some important tags.\n\nReady to learn some more advanced HTML? Move on to Learn More HTML in 12 Minutes\nhttp://youtu.be/KJ13lX20FqU\n\nLearn CSS in 12 Minutes\nhttp://youtu.be/0afZj1G0BIE\n\nLearn JavaScript in 12 Minutes\nhttp://youtu.be/Ukg_U3CnJWI\n\nLooking to do something more advanced with a webpage? PHP is one of the most useful languages to know when developing for the web. Check out my video Learn PHP in 15 Minutes: http://youtu.be/ZdP0KM49IVk\n\nhttp://jakewright.net', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/bWPMSSsVdPk" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=bWPMSSsVdPk', 'htmlcomputerwebinternethtmlhypertextmarkuplanguagewebpagesiteonlinejakewrightwindowsnotepadbuildlearntutorial', '2016-06-05', '2016-06-05'),
(163, 'HTML and CSS Tutorial for Beginners | The Ultimate guide to learning HTML and CSS', 'y3UH2gAhwPI', 'HTML and CSS Tutorial for Beginners | The Ultimate guide to learning HTML and CSS\n----------\nI donot own this video. It''s so helpful so I reupload to share to more people!\n--------------\n\nhere isn''t a web site out there-- whether it be WhiteHouse.gov, IBM.com or the site for your local high school-- that isn''t written in HTML. If you do any level of web development-- from editing pages on a Wordpress site to designing original pages from scratch, understanding and being able to code in HTML and CSS can give you a level of control, and power over your designs that you''ve never experienced before. This course helps you learn HTML and CSS (versions 4.01 and XHTML) as well as prepares you for the future with coverage of HTML5.\n\nIn this HTML and CSS course/tutorial for beginners, designed, authored and hosted by master trainer Mark Lassoff, you will learn HTML and CSS, including everything you need to create a creative, quality and professional web site. Almost four hours of video instruction in punctuated lab exercises where you apply the very skills taught in the course. With an instructor available to answer your questions, and course with both wide coverage of HTML and CSS topics and deep discussion of those topics, there is no better or faster way to learn HTML and CSS for Beginners!\n\nWhen you''ve completed the HTML and CSS course, become a certified developer by passing LearnToProgram''s Certified HTML Developer exam. Certified developers are listed on the LearnToProgram web site and sent a printed certificate, digital badges and other materials relating to their certified status.\n\nDuring this Learn HTML and CSS Crash course, you’ll discover necessary elements behind becoming a web developer.\n\nThe objective of this “crash course” is to take someone who is a “mouse and keyboard” user and teach them the essentials of web development by teaching HTML, CSS and some HTML5.This is a fundamental course for learning HTML and it does not assume that participants have prior knowledge.\n\nBy the end of the HTML and CSS Crash Course, you will know the essentials for creating your first website.\n\nHere is great HTML and CSS Tutorial for Beginners | The Ultimate guide to learning HTML and CSS', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/y3UH2gAhwPI" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=y3UH2gAhwPI', 'tutorialHTMLCSSHTML5CSS3HTML and CSSWeb DesignTutorialsWeb Design Tutorial for Beginners', '2016-06-05', '2016-06-05'),
(164, 'Introduction to HTML Programming', 'fS7w-TXinPE', 'Attend Question/ Answer MEETUP: http://goo.gl/kPHGFw\n\nFollow Eli on the Vlog Channel: https://www.youtube.com/user/EliCompu...\n\nInfo\n\nLevel: Beginner\nPresenter: Eli the Computer Guy\nLength of Class: 100 Minutes\nTracks\n\nWeb Design\nPrerequisites\n\nIntroduction to Website Administration\nPurpose of Class\n\nThis class teaches students basic HTML Programming.  After taking this class students will be able to code basic HTML web pages and write raw HTML code for sites such as Craigslist.\nTopics Covered\n\nCreating an HTML Page\nFormatting Text\nCreating Lists\nCreating Tables\nAdding Pictures\nAdding Hyperlinks\nClass Notes\n\nIntroduction\nHTML is still very relevant for web programming\nHTML is used  to create Static Web Pages and for Formating\nThe Basics\nSuffix has to be with .htm or .html\nHome page has to be named INDEX or DEFAULT\nDifferent web browsers display things differently\nDeprecated means you should not use\nIf you have a LINUX web server you have to make sure you use correct capitalization', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/fS7w-TXinPE" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=fS7w-TXinPE', 'Web Design Tutorial for BeginnersIntroductiontoHTMLProgramming', '2016-06-05', '2016-06-05'),
