(167, 'Learn JavaScript in 12 Minutes', 'Ukg_U3CnJWI', 'Learn the fundamental features of JavaScript - the language used to add dynamic, interactive content to websites. I teach you how to get started with JavaScript, how to use variables, operators, arrays, properties, methods, custom functions, conditionals and loops. In 12 minutes.\n\nLEARN HTML IN 12 MINUTES\nhttp://youtu.be/bWPMSSsVdPk\n\nLEARN CSS IN 12 MINUTES\nhttp://youtu.be/0afZj1G0BIE\n\nLEARN PHP IN 15 MINUTES\nhttp://youtu.be/ZdP0KM49IVk\n\n---------- Text Editors ----------\n\nFor Windows users, I recommend using Notepad++ to edit HTML files:\nhttp://notepad-plus-plus.org\n\nFor Mac users, I recommend Sublime Text:\nhttp://www.sublimetext.com\n\n----------------------------------------\n\nSUBSCRIBE FOR MORE\nhttp://youtube.com/subscription_center?add_user=jaketvee\n\nTWITTER http://twitter.com/jakewrightuk\nFACEBOOK https://www.facebook.com/jakewrightuk\nINSTAGRAM http://instagram.com/jakewrightuk\n\nhttp://jakewright.net', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/Ukg_U3CnJWI" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=Ukg_U3CnJWI', 'javascriptjakewrightcomputersciencejavascripttutorialhow tomakewebsitefrom scratchcodebuildprogramdynamicquicklessoncambridgeonlineinteractivehtmlhelpinternethypertextmarkuplanguagejavasitewindowsmacnotepadcustom', '2016-06-05', '2016-06-05');
