(168, 'JavaScript: Understanding the Weird Parts - The First 3.5 Hours', 'Bv_5Zv5c-Ts', 'Full 12 hour course on sale for $19! https://www.udemy.com/understand-javascript/?couponCode=YOUTUBE19 (normal price $149)\n\nThis is an advanced Javascript course for everyone, giving a deep understanding of the language by understanding how it works under the hood.\n\nIn the full course, you will enhance your abilities as a Javascript developer by delving into first class functions, callbacks, closures, IIFEs, prototypal inheritance, diving into the source code of jQuery, and building your own small framework/library.\n\nLinks from the first 3.5 hours: Operator precedence: https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Operator_Precedence and equalitiy comparison: https://developer.mozilla.org/en-US/docs/Web/JavaScript/Equality_comparisons_and_sameness', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/Bv_5Zv5c-Ts" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=Bv_5Zv5c-Ts', 'customJavaScript (Programming Language)Web Design (Interest)Programming Language (Software Genre)Tutorial (Media Genre)Advanced Javascript', '2016-06-05', '2016-06-05'),
(169, '10 Things To Master For JavaScript Beginners', '6MaOPdQPvow', '10 Things to Master to Become A Good JavaScript Developer is a top ten list featuring 10 areas I think you should focus on in order to become a good JavaScript developer.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/6MaOPdQPvow" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=6MaOPdQPvow', 'Advanced Javascriptjs10thingsjavascripttipstutorialideashelpnoobeasybeginnerhow tolearncode10 Things to Master to Become A Good JavaScript DeveloperJavaScript Developerjavascript programmermaster javascript', '2016-06-05', '2016-06-05'),
(170, 'JavaScript Tutorial', 'fju9ii8YsGs', 'Get the Cheat Sheet Here : http://goo.gl/TxNsQO\nBest Book on JavaScript : http://amzn.to/1WbMYvm\n\nSupport Me on Patreon : https://www.patreon.com/derekbanas\n\n00:22 Introduction\n03:27 Variables\n04:27 Math\n12:00 Random Numbers\n13:21 Strings\n17:24 Styling Strings\n18:14 If\n21:44 Switch\n23:04 Ternary Operator\n23:55 While\n24:51 Do While\n25:52 For\n27:37 For In\n28:39 Arrays\n34:42 Functions\n36:41 Pass Function as Parameter\n39:42 Receive Variable Number of Arguments\n40:55 Return Variable Number of Arguments\n42:02 Recursive Functions\n43:54 Event Handling\n46:24 Mouse Events\n51:30 Key Events\n54:02 Change Tag Value\n56:41 Change Class\n58:02 Change Input Element\n59:20 Mouse X / Y Coordinates\n1:01:42 Get Elements by Tag Name\n1:03:00 Element Styling\n1:05:48 Manipulating URLs\n1:09:37 Editing Child Nodes\n1:15:08 Setting Attributes\n1:18:11 Adding Elements\n1:19:50 OO JavaScript\n1:28:33 Form Validation\n1:34:54 Exception Handling', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/fju9ii8YsGs" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=fju9ii8YsGs', 'master javascriptJavaScript (Programming Language)JavaScript TutorialLearn JavaScriptJavaScript ProgrammingProgramming Language (Software Genre)', '2016-06-05', '2016-06-05'),
(171, 'JavaScript Video Tutorial Pt 1', '_cLvpJY2deo', 'Best JavaScript Book : http://goo.gl/zodRHD\n\nHere I teach you how to write JavaScript programs in just 30 minutes. I specifically cover : JavaScript Datatypes, Embedding JavaScript, Linking to JavaScript, Conditional Statements, Looping, Arrays, Strings, Functions and much more.\n\nArticle is Here: http://bit.ly/fUvtp8\nCode is Here: http://bit.ly/hoF0Fe', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/_cLvpJY2deo" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=_cLvpJY2deo', 'Programming Language (Software Genre)JavaScriptTutorialVideoHow ToLearn JavaScript', '2016-06-05', '2016-06-05'),
(172, 'Curso Básico de Javascript desde 0 - Introducción', 'xnWtGNiG2lg', '? Nuevo! Curso de PHP y MYSQL: Completo, Práctico y desde Cero\n? Curso a tan solo 10 Dólares (90% descuento antes del 31 de Enero): https://goo.gl/I3hh3H\n\n- - -\n\nEn este primer capitulo veremos que es Javascript y lo que necesitamos para poder comenzar a programar en JS.\n\n? Blog de diseño web: \n   http://www.falconmasters.com\n\n? Necesitas ayuda con el tutorial? Únete a nuestra comunidad:\n   http://www.heroesdelaweb.com\n\n---\nRedes Sociales:\n\n? Twitter @falconmasters:\n   http://www.twitter.com/falconmasters \n\n? Pagina de Facebook:\n   http://www.facebook.com/falconmasters', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/xnWtGNiG2lg" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=xnWtGNiG2lg', 'Learn JavaScriptJavaScript (Programming Language)cursobasicotutorialcomo hacerusarJavaScriptJSWeb Development (Interest)Introduccionvariablesfuncionesarreglosarraysvectoresaplicaciones webpaginas websitios webdiseño webscriptlenguajeprogramacionJqueryNode', '2016-06-05', '2016-06-05'),
(173, 'Object Oriented JavaScript', 'O8wwnhdkPE4', 'Get the Cheat Sheet Here : http://goo.gl/CQVZsW\nBest Object Oriented JavaScript Book : http://amzn.to/1L0Mvs8\n\nSupport me on Patreon : https://www.patreon.com/derekbanas\n\n01:50 JavaScript Objects\n02:36 Objects in Objects\n04:12 Constructor Functions\n05:58 instanceof\n06:28 Passing Objects to Functions\n08:09 Prototypes\n09:34 Adding Properties to Objects\n10:44 List Properties in Objects\n11:38 hasOwnProperty\n12:42 Add Properties to Built in Objects\n14:31 Private Properties\n18:01 Getters / Setters\n21:20 defineGetter / defineSetter\n24:38 defineProperty\n27:07 Constructor Function Getters / Setters\n29:40 Inheritance\n37:13 Intermediate Function Inheritance\n39:14 Call Parent Functions\n41:51 ECMAScript 6\n47:31 Singleton Pattern\n49:32 Factory Pattern\n52:53 Decorator Pattern\n54:52 Observer Pattern', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/O8wwnhdkPE4" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=O8wwnhdkPE4', 'completoJavaScript (Programming Language)Object-oriented Programming (Programming Language Paradigm)Programming Language (Software Genre)ECMAScriptECMAScript 6Object Oriented JavaScriptOOP JavaScript', '2016-06-05', '2016-06-05'),
(174, 'Douglas Crockford: The JavaScript Programming Language', 'v2ifWcnQs6M', 'In this 2007 presentation at Yahoo!, which is meant to be the beginning of a three-course sequence (followed by "Theory of the DOM" and then "Advanced JavaScript"), Douglas Crockford explores not only the language as it is today but also how the language came to be the way it is.\r\n\r\nNote: there''s a title at the opening that claims this is "Part 1 of 4", but this video contains all four parts edited together. No need to go searching for the missing parts.', 0, '<iframe width="480" height="360" src="//www.youtube.com/embed/v2ifWcnQs6M" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=v2ifWcnQs6M', 'OOP JavaScriptcrockfordjavascriptprogrammingwebdevfrontend engineeringyahooyui', '2016-06-05', '2016-06-05'),
(175, 'Javascript Tutorial - Programming Tutorial for Beginners Pt 1', 'vZBCTc9zHtI', 'This is part one of Javascript Programming.  If you''ve been wanting to learn Javascript, this will help you get a quick head start.  We''ll cover the very basics and get you prepared for part 2 which will teach you to use jQuery to do some fun stuff to your web page in real time!\n\nOnce you have it, Here''s video 2!: http://youtu.be/WGPaZNYrHpo\n\nLearning Javascript (or learning programming of any kind) can feel a bit uncomfortable at first, but I promise it will come quickly.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/vZBCTc9zHtI" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=vZBCTc9zHtI', 'yuiJavaScript (Programming Language)javascript tutorialProgramming Language (Literary Genre)javascript lessonlearn javascriptfor beginnersjavascript tutorial for beginnersjavascript for beginnersjavascript tutorial beginnersbeginnerstutoriallessonWeb Desi', '2016-06-05', '2016-06-05'),
(176, 'JavaScript Tutorial for Absolute Beginners', 'XL9Ri8pO68w', 'MEAN Stack 2.0 - Learn Angular 2, Node.js, Express and MongoDb  ? http://on.codek.tv/NJzo_H4ZZ\nJavaScript: Understanding the Weird Parts ? https://hii.to/NJS3SH4wl\nLearn and Understand AngularJS ? https://hii.to/Ny4NPdSwg\nLearn Bootstrap Development By Building 10 Projects http://bit.ly/1UYJRHu\nLearn Nodejs by building 10 projects http://bit.ly/1TyN6DP\nES6 and ES7 the future of Javascript http://goo.gl/U3zIX1\n\nZero to Hero with Node.js\nhttps://goo.gl/Pm4lLj\n\nJavaScript with ReactJS and Nodejs\nhttps://goo.gl/sSfjXV\n\nJavaScript and Node.js Fundamentals\nhttps://goo.gl/Pr2p2F\n\nSingle Page Applications with jQuery or AngularJS\nhttp://goo.gl/6RhW7g\n\nZero to Hero with AngularJS at 2015\nhttp://goo.gl/E5J8es', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/XL9Ri8pO68w" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=XL9Ri8pO68w', 'Web Developer (Job Title)javascript tutorialjavascript tutorial for beginnersJavaScript (Programming Language)', '2016-06-05', '2016-06-05'),
(177, 'Hidden Internet | Deep Web & Dark Web Explained', 'NCFi9mgPyog', 'Namaskaar Dosto, maine aapko is video mein ek bahut hi unique concept ke baare mein batay ahi, jiska naam hai Deep Web and Dark Web, Internet toh aap sabhi use karte honge, but aapne shayad iske baare mein pehle kabhi nahi suna ho, Deep Web aur Dark Web ke baare mein aap bahut si baatein hai jo is video mein jan payenge. \n\nDeep Web aur Dark Web Normal internet ka hissa nahi hai, but ek tarek se extension hai jise ek normal user access nahi kar paata, aur yeh dono mil ke majority of the Internet construct karte hai. Maine aapko is video mein TOR ke baare mein bhi bataya hai jo ki Dark Web ko access karne mein kaam aata hai. \n\nShare, Support, Subscribe!!!\nSubscribe: http://bit.ly/1Wfsvt4\nYoutube: http://www.youtube.com/c/TechnicalGuruji \nTwitter:  http://www.twitter.com/technicalguruji\nFacebook: http://www.facebook.com/technicalguruji\nInstagram: http://instagram.com/technicalguruji\nGoogle Plus: https://plus.google.com/+TechnicalGuruji\n\nAbout : Technical Guruji is a YouTube Channel, where you will find technological videos in Hindi, New Video is Posted Everyday :)', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/NCFi9mgPyog" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=NCFi9mgPyog', 'webDeep WEbDark Webwhat ishow to useinternettor browserdark internetdeep internetexplainedexplorationdeep webwebconnectivitytoronion routerproxyDeep NetDark Web StoriesDeep web horror storiesSilk RoadDeep Web DrugsDeep Web GunsBlack MarketDeep Web LinksIn', '2016-06-05', '2016-06-05'),
(178, 'AnyPixel.js - a web friendly way for anyone to make unusual displays', '58pxJ8z1Vow', 'AnyPixel.js is an open source software and hardware library created here at Google, making it possible to use the web to create big, unusual, interactive displays out of all kinds of things. Anyone can take the code and the schematics to create their own display at any scale or level of expertise.  \n \nThe first display using this platform is in the 8th Avenue lobby at the Google NYC office. To create this installation, we used 5880 off-the-shelf arcade buttons as our pixels. \n\nLearn more about the project and how to create your own AnyPixel.js display at https://goo.gl/anypixel', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/58pxJ8z1Vow" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=58pxJ8z1Vow', 'technicalgurujiGoogledevelopersanypixelanypixel.jsopen sourceunusualinteractivebigdisplayNYCofficelobby8theighthaveavenuejavascriptcreativeapplicationtouchscreenbuttonbuttonwallarcadeinstallationproduct: otherfullname: otherLocation: otherTeam: OtherType:', '2016-06-05', '2016-06-05'),
