(187, 'Archiculture: a documentary film that explores the architectural studio (full 25 min film)', '62r3UPrOS9k', 'Archiculture takes a thoughtful, yet critical look at the architectural studio. The 25-minute film offers a unique glimpse into the world of studio-based, design education through the eyes of a group of students finishing their final design projects. Interviews with leading professionals, historians and educators help create crucial dialog around the key issues faced by this unique teaching methodology and the built environment these future architects will create.\n\nStarring:\nMollie Claypool\nAlanna Jaworski\nDionysios Neofitidis\nMike Toste\nGiancarlo Tramontozzi\n\nIncluding Interviews with:\nShigeru Ban - Shigeru Ban Architects\nMatthew Berman - Workshop APD\nPhil Bernstein - VP Autodesk\nJoe Brown - CIO AECOM\nDavid Byrne - Musician/Artist\nAnnie Choi - Author/Critic\nMaurice Cox - Professor/NEA\nKen Frampton - Historian/Professor\nTerry Heinlein - TGH Architect\nTed Landsmark - President BAC\nThom Mayne - Morphosis\nMary Woods - Historian/Professor\n\nCredits:\nCo-Producer/Director - David Krantz & Ian Harris\nEditor - Jesse Garrison\nSound Editor and Re-Recording Mixer - Yoni Slotwiner\nComposer - Glenn Forsythe\nColorist - Frederick Trevino\nTitles and Graphics - Matthew Posorske\nStory Development - Eric Krantz\nAssistant Editors - Bill Scurry, Randy Astle, Eric Joseph, Aaron Lim, Marco Monti & Justin Strawhand\nProduction/Editing Assistants - Pierce Cook, Emily Wettstein & Emily Ahn Levy\nProduction Assistant - Michael Selwa\nPre-Production Assistant - Lisa Zigenis\nGrant Writer/Editor - Jacob Richardson\nMarketing - Sam Danner\nOutreach - Emily Goligoski & Barbie Steffen\nPublic Relations - Whitney Sterling & Julie Fallin\nWebsite Consultant - Doug Havens \nLegal Services - George M. Rush\nExecutive Producer - AECOM\nFiscal Sponsor - Independent Film Project (IFP)\n\nBe sure to SUBSCRIBE to see a new Architecture Extras Interview each week!\n\nProduced, shot and edited by Arbuckle Industries - http://www.arbuckle-industries.com.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/62r3UPrOS9k" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=62r3UPrOS9k', 'architectureArbuckle IndustriesDocumentary (TV Genre)Film (Media Genre)Architecture (Industry)Urban Design (Field Of Study)Landscape Architecture (Industry)Architect (Profession)Designer (Profession)Design (Industry)Pratt Institute (College/University)Edu', '2016-06-05', '2016-06-05'),
(188, 'Why great architecture should tell a story | Ole Scheeren', 'iQsnObyii4Q', 'For architect Ole Scheeren, the people who live and work inside a building are as much a part of that building as concrete, steel and glass. He asks: Can architecture be about collaboration and storytelling instead of the isolation and hierarchy of a typical skyscraper? Visit five of Scheeren''s buildings — from a twisted tower in China to a floating cinema in the ocean in Thailand — and learn the stories behind them.\n\nTEDTalks is a daily video podcast of the best talks and performances from the TED Conference, where the world''s leading thinkers and doers give the talk of their lives in 18 minutes (or less). Look for talks on Technology, Entertainment and Design -- plus science, business, global issues, the arts and much more.\nFind closed captions and translated subtitles in many languages at http://www.ted.com/translate\n\nFollow TED news on Twitter: http://www.twitter.com/tednews\nLike TED on Facebook: https://www.facebook.com/TED\n\nSubscribe to our channel: http://www.youtube.com/user/TEDtalksDirector', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/iQsnObyii4Q" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=iQsnObyii4Q', 'College (TV Genre)TED TalkTED TalksOle Scheerenarchitecturedesignbuildingsarchitect', '2016-06-05', '2016-06-05'),
(189, '10 Biggest Architecture Fails In The World', 'gi9u6VgGn3k', 'Top 10 shocking architectural failures in history! \nSubscribe to our channel: http://goo.gl/9CwQhg\n\nFor copyright matters please contact us at: david.f@valnetinc.com\n\nOther Videos You Might Like\nRoads You Wouldn''t Want To Drive On https://youtu.be/ym4uVS-5tSA?list=PLXK3uPjJ22FUgkmE10ySoALx9YjknvXHI\nThe Largest Things In The World https://youtu.be/V1lfjKqGgf8?list=PLXK3uPjJ22FUgkmE10ySoALx9YjknvXHI\n\nDescription:\nArchitecture is one of the most astounding and complex professions in the world today. It has only been well over a century since skyscrapers first made their appearance in the late nineteenth century, complete with photos of the construction that alarmingly include men eating their lunch thousands of feet into the air with nothing to hang on to should they fall. Architecture requires some of the most brilliant minds in the world today, as complex designs have to have a way to stay standing. If you look at buildings from the earlier times, they looked like square boxes with some windows. But the innovation of design has challenged architects to be more creative and productive in their designs. From buildings to bridges, people want more aesthetics than functionality these days. However, functionality is crucial because it can make the difference between life and death. \nIf a student makes an error on their test, the worst thing that will happen is that they get a bad grade. If an artist messes up on a piece, the worst thing that will happen is that there was time lost and wasted. But if an architect makes an error, then there is more devastation and more at risk. If an architect writes up plans that are flawed, and those plans are published around the world, then there is potential for worldwide catastrophe. When it all comes down to it, architectural failures can be devastating and lives can be lost at epic proportions.\nIn this video are ten of the biggest architecture failures that have ever occurred around the world. Not only did these fails result in monetary loss, but also resulted in catastrophic damage to the people involved that involved PTSD and death. From the collapse of bridges to the downfall of some of the mightiest buildings to have ever existed, these failures are a grim reminder that we are still not perfect and have a lot of work to do in terms of how much we can create on our own.\nSometimes loss of life isn’t the only major issue when it comes to architecture failures. Sometimes it’s something as simple as color of the building. Take the Walt Disney Concert Hall and the Vdara Hotel and Spa. The buildings are both very shiny and reflect the sun, thus unintentionally creating a massive heat ray that moves as the Earth moves around the sun. People have actually reported their hair getting singe and plastic melting from the rays coming off of the buildings. Perhaps that’s why we don’t see many silver buildings anymore?\nThe entries in this video are both tragic and humorous. As the art of architecture continues to evolve and change, we will likely see more failures come as experimentation in the building world continues to progress. We are learning with each building how to create something bigger and better, along with making sure that the building is safe and not put together with paperclips, glue, and maybe a few thumbtacks.\n\n\n\nOur Social Media:\nFacebook: https://www.facebook.com/TheRichest.org\nTwitter: https://twitter.com/TheRichest_Com\nInstagram: http://instagram.com/therichest\n\nFeaturing:\nSavar Building\nCitigroup Center\nWalt Disney Concert Hall\nKatowice Trade Hall\nLotus Riverside\nSilver Bridge\nKemper Arena\nJohn Hancock Tower\nVdara Hotel & Spa\nHotel New World\n\n\n\nFor more videos and articles visit:\nhttp://www.therichest.com/\n\nTheRichest is the world''s leading source of shocking and intriguing content surrounding celebrities, money, global events, society, pop culture, sports and much more. We create high quality top 10 and top 5 list based videos filled with mind blowing interesting and entertaining facts you are going to love and enjoy. Currently updating every day!', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/gi9u6VgGn3k" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=gi9u6VgGn3k', 'architectTop10Top5ListViralFactsmostbestArchitecture (Industry)failfailurebuildingbuildsitebridgefailsbadworsteverterribleincredibleshockingstupiddumbskyscraperGreatestconstructiondesignSavar BuildingCitigroup CenterWalt Disney Concert HallKatowice Trade ', '2016-06-05', '2016-06-05'),
(190, 'Talking Art, Acid and Architecture with Filmmaker Jonathan Meades', 'uCDavz2lz8k', 'VICE’s Gavin Haynes meets the surrealist television personality, film-maker, architecture critic, essayist and now artist, Jonathan Meades at his first exhibition of Abstract Expressionist paintings at the Redchurch Gallery in Shoreditch.\n\nClick here to subscribe to VICE: http://bit.ly/Subscribe-to-VICE\n\nCheck out our full video catalog: http://bit.ly/VICE-Videos\nVideos, daily editorial and more: http://vice.com\nMore videos from the VICE network: https://www.fb.com/vicevideo\nLike VICE on Facebook: http://fb.com/vice\nFollow VICE on Twitter: http://twitter.com/vice\nRead our Tumblr: http://vicemag.tumblr.com\nFollow us on Instagram: http://instagram.com/vice\nCheck out our Pinterest: https://pinterest.com/vicemag', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/uCDavz2lz8k" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=uCDavz2lz8k', 'therichestdocumentarydocumentariesinterviewinterviewsculturewildlifestyleworldexclusiveindependentundergroundvideosfunnyfunny videosjournalismvice guidevice presentsvice newsvbs.tvvice.comvicevice magazinevice magvice videostalk showjonathan meadesfilmmod', '2016-06-05', '2016-06-05'),
(191, 'Advances in Architectural Geometry - MIT', 'vRfNbhyPPKs', 'The MIT Center for Art, Science & Technology (CAST) and the MIT Department of Architecture co-sponsored a video that was featured at the "Advances in Architectural Geometry" symposium at the Centre Pompidou in Paris from September 27-30, 2012. Architectural geometry is an emerging field using geometrical principles to approach current design challenges with a renewed mathematical rigor. As part of a presentation on the most advanced and challenging research in the field, the video spotlights the groundbreaking technologies, materials, and processes produced at MIT.\n\nCurated by Skylar Tibbits.\n\nExhibited work and comments by:\n\nMaterial: John Fernandez\nAssociate Professor, Building Technology Faculty, Department of Architecture\nPrincipal and Founder of LFArc and Urban Metabolism Group\n\nScale: Skylar Tibbits\nLecturer, Design Faculty, Department of Architecture, MIT\nPrincipal and Founder of SJET LLC\n\nPrototype: William O''Brien Jr.\nAssistant Professor, Department of Architecture\nPrincipal, William O''Brien Jr. LLC\n\nMovement: Joel Lamere \nAssistant Professor, Design Faculty, Department of Architecture, MIT\nPrincipal and Founder of GLD\n\nModules: Nader Tehrani\nDepartment Chair, Department of Architecture, MIT\nPrincipal and Founder of NADAA\n\nInteraction: Meejin Yoon\nAssociate Professor, Design, Faculty, Department of Architecture, MIT\nPrincipal and Founder of Howeler + Yoon/MY Studio\n\nInnovation: Sheila Kennedy\nProfessor of Practice, Design Faculty, Department of Architecture, MIT\nPrincipal and Founder of Kennedy &amp; Violich, www.kvarch.net\n\nDigital: Mark Goulthorpe\nAssociate Professor, Design, Faculty, Department of Architecture, MIT\nPrincipal and Founder of dECOi Architects, HypoSurface Corp and Zero+', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/vRfNbhyPPKs" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=vRfNbhyPPKs', 'STALINarchgeometry', '2016-06-05', '2016-06-05'),
(192, 'Top 10 Iconic Pieces of Architecture', '9_WAAbER3kM', 'For these marvelous structures, inspiring awe and wonder is as simple as just being there. Join http://www.WatchMojo.com as we count down our picks for the Top 10 Iconic Pieces of Architecture. Subscribe??http://www.youtube.com/subscription_center?add_user=watchmojo Facebook??http://www.Facebook.com/WatchMojo. Twitter??http://www.Twitter.com/WatchMojo\nInstagram??http://instagram.com/watchmojo Suggestion Tool??http://www.WatchMojo.com/suggest Channel Page??http://www.youtube.com/watchmojo\n\nFor this list, we''re taking a look at the world''s most famous artificial structures and are basing our choices on a mix of their design aesthetics, their capacities to influence and inspire, and of course, their iconic statuses. \n\nSpecial thanks to our user ian_a_wm2014 for submitting the idea on our Interactive Suggestion Tool at http://www.WatchMojo.com/suggest\n\nCheck out the voting page here, \nhttp://watchmojo.com/suggest/Top+10+Iconic+Pieces+of+Architecture\n\nWant a WatchMojo cup, mug, t-shirts, pen, sticker and even a water bottle?  Get them all when you order your MojoBox gift set here:\nhttp://watchmojo.com/store/\n\nWatchMojo is a leading producer of reference online video content, covering the People, Places and Trends you care about.\nWe update DAILY with 4-5 Top 10 lists, Origins, Biographies, Versus clips on movies, video games, music, pop culture and more!', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/9_WAAbER3kM" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=9_WAAbER3kM', 'geometryiconic architecturestatue of libertyelizabeth towersagrada familiasydney opera housetaj mahalcathedral of vasilly the blessedthe colosseumeiffel towergreat wall of chinagreat pyramid of gizawestminster abbeytop 10geographytraveldesignhistoryarchit', '2016-06-05', '2016-06-05'),
(193, 'America''s Best Architecture | ARTLAND | Reserve Channel', '8zBG1xML8U0', 'Visit the Salk Institute, the chapel at the US Air Force Academy,  Trinity Church, Falling Water by Frank Lloyd Wright, and the St. Louis Gateway Arch as we recap the best architecture visited on ARTLAND with Mame McCutchin & Charlie Luxton.\n\nSUBSCRIBE: http://full.sc/VX9hqH\n\nReserve Channel:\nReserve Channel provides once-in-a-lifetime access to some of the more extraordinary people and places life has to offer. Whether it''s traveling to exotic locales, getting inside the studio with iconic artists, or cooking alongside culinary legends, Reserve Channel has you on the list. This is where the content appetite of the cultural creatives is satisfied.\n\nReserve Channel Social Media:\nFOLLOW US TWITTER: http://full.sc/VXoWpU \nLIKE US ON FACEBOOK: http://full.sc/PUaj19 \nGOOGLE+: http://full.sc/PUaoSk\n\n*CHECK OUT OUR OTHER SHOWS*\nHOOKED UP w/ Tom Colicchio: http://full.sc/XhdFkJ\nACROSS THE BOARD with Joy Bryant: http://full.sc/TUWErV\nARTST TLK with Pharrell Williams:  http://full.sc/XhdMwW\nBE WELL WEEK with Dr. Lipman: http://full.sc/VXoKqu\nON THE TABLE with Eric Ripert: http://full.sc/VX9zO9\nCAPTURE with Mark Seliger: http://full.sc/PTZD2q\nEX-PATS: http://full.sc/VX9Nol\n\nAmerica''s Best Architecture | ARTLAND | Reserve Channel \nhttp://www.youtube.com/user/reservechannel', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/8zBG1xML8U0" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=8zBG1xML8U0', 'architectureReserveChannelReserve ChannelUncommonContentUCPextraordinary peopleculturecelebritiesdoctorschefsnon-fictionnon fictionoriginalUS Air Force AcademyUSAAFTrinity ChurchFalling WaterFrank Lloyd WrightARTLANDMame McCutchinCharlie LuxtonSt. Louis G', '2016-06-05', '2016-06-05'),
