(195, 'Architecture is a Language: Daniel Libeskind at TEDxDUBLIN', 'yEkDosanxGk', 'TEDxDublin was hosted by Science Gallery at the Bord Gáis Energy Theatre on September 8th, 2012. http://www.TEDxDublin.com\n\nDaniel Libeskind believes that buildings are crafted with perceptible human energy, and that they address the greater cultural context in which they are built. Best known for designing iconic buildings like the Jewish Museum in Berlin and the Royal Ontario Museum in Toronto, Libeskind also designed the Bord Gáis Energy Theatre and the masterplan for the new World Trade Center site in New York City. His commitment to expanding the scope of architecture reflects his profound interest and involvement in philosophy, art, literature and music. \n\nIn the spirit of ideas worth spreading, TEDx is a program of local, self-organized events that bring people together to share a TED-like experience. At a TEDx event, TEDTalks video and live speakers combine to spark deep discussion and connection in a small group. These local, self-organized events are branded TEDx, where x = independently organized TED event. The TED Conference provides general guidance for the TEDx program, but individual TEDx events are self-organized.* (*Subject to certain rules and regulations)', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/yEkDosanxGk" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=yEkDosanxGk', 'college adviceDaniel Libeskindted talksSustainabilitytedCultureted xEnglishDesignIrelandTEDxDUBLINcommunitytedx talksted talktedx talkArchitecturecitiestedx', '2016-06-05', '2016-06-05'),
