(197, 'The First Secret of Great Design | Tony Fadell | TED Talks', '9uOMectkCCs', 'As human beings, we get used to "the way things are" really fast. But for designers, the way things are is an opportunity ... Could things be better? How? In this funny, breezy talk, the man behind the iPod and the Nest thermostat shares some of his tips for noticing — and driving — change.\n\nTEDTalks is a daily video podcast of the best talks and performances from the TED Conference, where the world''s leading thinkers and doers give the talk of their lives in 18 minutes (or less). Look for talks on Technology, Entertainment and Design -- plus science, business, global issues, the arts and much more.\nFind closed captions and translated subtitles in many languages at http://www.ted.com/talks/tony_fadell_the_first_secret_of_design_is_noticing\n\nFollow TED news on Twitter: http://www.twitter.com/tednews\nLike TED on Facebook: https://www.facebook.com/TED\n\nSubscribe to our channel: http://www.youtube.com/user/TEDtalksDirector', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/9uOMectkCCs" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=9uOMectkCCs', 'designTEDTalkTEDTalksTED TalkTED TalksTEDdesignproducttechnologyTony Fadellbusinessapple', '2016-06-05', '2016-06-05'),
