(205, 'Aaron Draplin Takes On a Logo Design Challenge', 'zOPA0NaeTBk', 'Most logos aren''t designed in fifteen minutes, but most designers aren''t Aaron Draplin. Aaron''s a Portland fixture by way of the Midwest, the owner of Draplin Design Co., and an advocate of "blue collar" design: design that works. Here he takes our logo design challenge, creating a dozen iterations of a logo for a fictional construction company. Not inspired? Just wait. Watch as he sketches, brings his ideas into Illustrator, and tests and tunes the different iterations. The logos Aaron creates prove design can elevate any company or brand. Along the way, he provides tips for freelancing, finding inspiration, and providing clients context for logos that won''t just live in PDFs.\n\nAfter watching, visit www.lynda.com/10-day-trial-for-youtube to start a free 10 day trial with lynda.com', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/zOPA0NaeTBk" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=zOPA0NaeTBk', 'first stageLogoDesign (Industry)Challengeaaron draplinDDCDraplin Design Colynda.com', '2016-06-05', '2016-06-05'),
(206, 'Galaxy Note 7 design leaks, Huawei Daydream VR phone & more - Pocketnow Daily', 'cngF6zBmys8', 'Stories:\n- 64GB Moto X Pure Edition and Moto 360 Sport offered for combined $400 ($350 off) http://pocketnow.com/2016/06/03/64gb-moto-x-pure-edition-moto-360-sport-bundle-deal\n- Nexus 6P sale turns on, starts at $419 http://pocketnow.com/2016/06/03/daydream-vr-compatible-huawei-phone-confirmed\n- Daydream VR-compatible Huawei phone definitely coming this fall http://pocketnow.com/2016/06/03/daydream-vr-compatible-huawei-phone-confirmed\n- Samsung Gear Fit 2 launches soon, Gear IconX gets shown off http://pocketnow.com/2016/06/02/samsung-gear-fit-2-launches-gear-iconx-debut\n- Blueprint-based render video purports to show familiar-looking Galaxy Note 6/Note 7 http://pocketnow.com/2016/06/03/samsung-galaxy-note-6-or-note-7-showcased-in-render-video\n\nWatch today''s Pocketnow Daily as we talk about the recent deals in case you want a Moto X Pure Edition, in addition to a Moto 360 Sport. Then we discuss some other deals that just emerged for the Google Nexus 6P as well. Huawei follows as we learn of the company''s plan to bring a high-end smartphone for later this year that''s compatible with Google''s Daydream VR. Samsung follows with its announcement of the Gear Fit 2, along with its new IconX headphones. We end today''s show talking about the recent blueprint video renders that show us the future design of the possible Samsung Galaxy Note 7.\n\nAll this and more after the break. \n\n\nSubscribe:\nhttp://www.youtube.com/subscription_center?add_user=Pocketnowvideo\nhttp://www.vessel.com/pocketnow\n\nAbout us:\nPocketnow has been a key source of mobile technology news and reviews since its establishment in 2000. With offices on three continents, Pocketnow offers round-the-clock coverage of the mobile technology landscape, from smartphones to tablets to wearables. We aim to be your number-one source for mobile tech news, reviews, comparisons, and commentary. If you love mobile as much as we do, be sure to subscribe!\n\nFollow us:\nhttp://pocketnow.com\nhttp://vessel.com/pocketnow\nhttp://twitter.com/pocketnow\nhttp://facebook.com/pocketnow\nhttp://google.com/+pocketnow\nhttp://instagram.com/pocketnow', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/cngF6zBmys8" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=cngF6zBmys8', 'lynda.comGalaxy Note 7 design leaksHuawei flagship Daydream VRSamsung Gear Fit 2Moto X Pure dealsGoogle Nexus 6P dealsMoto 360 Sport dealsDaydream VRGoogleAndroidSamsung IconXBlueprint rendersSamsungGalaxy Note 7rumorstech newssmartphonetabletsmartwatchPo', '2016-06-05', '2016-06-05'),
(207, 'Frameworks "Purge" Official Video', '48SjXLRA5SY', 'From the album "Smother" | In Stores July 8th | Pre-order now\nDW Store: http://bit.ly/1UEFBy2 | DW Europe Store: http://bit.ly/23uK8U3 | Bandcamp: http://bit.ly/1QTUfKW\niTunes: http://geni.us/4APn | Amazon: http://amzn.to/1OgO8R4 | Google Play: http://bit.ly/1rycxNf\n\nDirected by Max Moore | http://www.maxmoorefilms.com\n\nSince their 2011 inception, Gainesville''s Frameworks have become a favorite of many in the emotional hardcore scene. Creating music in the vein of Touché Amore, Explosions in the Sky, Modern Life Is War, and other uniquely powerful artists. After a string of EP releases, Frameworks released their "Loom" album on the Topshelf label in 2014. The album was well received worldwide by critics and listeners alike. In early 2016, Frameworks returned with their "Time Spent” EP. A well received release that showed the band broadening their approach through the use of darker, more experimental instrumentation.\n\n“Smother” is the highly anticipated sophomore album from Frameworks, and their first for the Deathwish label. The album was recorded by Matt McClellan (Being As An Ocean, O’ Brother, etc) at Glow In The Dark Studios and mastered by Brad Boatright (Converge, Self Defense Family, etc) at Audiosiege Mastering. “Smother” as a whole is a massive leap forward for Frameworks. The album dynamically pulses with hook-laden melodious riffs and moving emotional crescendos. All of it gushing with a rare creative beauty and maturity that will appeal to listeners from all corners of the underground music world.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/48SjXLRA5SY" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=48SjXLRA5SY', 'frameworksframeworkssmotherpurgealternativepunkhardcoreemotouche amorela distputepianos become the teethtitle fightmodern life is warenvyexplosions in the sky', '2016-06-05', '2016-06-05'),
(208, 'Frameworks - "Loom" (official video)', 'o3eG6ilfDi8', 'http://topshelfrecords.com/artists/frameworks\nhttp://topshelfrecords.com/artists/frameworks/products\n\nThe title track from "Loom" — Gainesville, FL''s Frameworks'' debut album. Available everywhere on CD, vinyl or digitally from Topshelf Records.\n\nDirector // Samuel Gursky & Eric Teti\nDirector of Photography // Eric Teti & John Komar\nEditor // Samuel Gursky & Lyle Zanca\nColorist // Matt Greenberg\nhttp://irvingharvey.com', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/o3eG6ilfDi8" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=o3eG6ilfDi8', 'explosions in the skytopshelfla disputeloomemoDeafheaven (Musical Group)La Dispute (Musical Group)touche amoreskramztopshelf recordsINDMUSICdeafheavenscreamoself defense familypunkbeau navirehardcoreframeworks', '2016-06-05', '2016-06-05'),
(209, 'Frameworks "Tangled"', 'zj0yCPA3XQM', 'From the album "Smother" | In Stores July 8th | Pre-order now\nDW Store: http://bit.ly/1UEFBy2 | DW Europe Store: http://bit.ly/23uK8U3 | Bandcamp: http://bit.ly/1QTUfKW\niTunes: http://geni.us/4APn | Amazon: http://amzn.to/1OgO8R4 | Google Play: http://bit.ly/1rycxNf\n\nSince their 2011 inception, Gainesville''s Frameworks have become a favorite of many in the emotional hardcore scene. Creating music in the vein of Touché Amore, Explosions in the Sky, Modern Life Is War, and other uniquely powerful artists. After a string of EP releases, Frameworks released their "Loom" album on the Topshelf label in 2014. The album was well received worldwide by critics and listeners alike. In early 2016, Frameworks returned with their "Time Spent” EP. A well received release that showed the band broadening their approach through the use of darker, more experimental instrumentation.\n\n“Smother” is the highly anticipated sophomore album from Frameworks, and their first for the Deathwish label. The album was recorded by Matt McClellan (Being As An Ocean, O’ Brother, etc) at Glow In The Dark Studios and mastered by Brad Boatright (Converge, Self Defense Family, etc) at Audiosiege Mastering. “Smother” as a whole is a massive leap forward for Frameworks. The album dynamically pulses with hook-laden melodious riffs and moving emotional crescendos. All of it gushing with a rare creative beauty and maturity that will appeal to listeners from all corners of the underground music world.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/zj0yCPA3XQM" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=zj0yCPA3XQM', 'frameworksframeworkssmotherdeathwishdeathwish inctouche amoremodern life is warpianos become the teethla disputetitle fightthe world is a beautiful placethe hotelierpunkhardcorealternativeemoscreamo', '2016-06-05', '2016-06-05'),
(210, 'Frameworks - Old Chokes', 'nW-TuSE_L4k', '"Old Chokes" comes from our new EP Small Victories. Grab digital + vinyl here - http://frameworks.limitedrun.com/\n\nhttp://www.facebook.com/frameworksband\nhttp://frameworksband.com\nhttp://frameworks.bandcamp.com\n\nLyrics\n\nWithering in gardens left dry\nWithering in gardens left dry\nI''m still soaked from their old chokes\n\nOh what a mess\nOh what a mess I''ve made now\nOh what a mess\nOh what a mess of things I''ve made\n\nIt''s such a shame; all that dirt couldn''t grow\nI put the blame all on the shine and less the soil\nWe must wilt away if we wish to someday grow\nBut I''ve wilted and waned over and over\nThe soil is as far as I can go\n\nThat night I lied awake thinking over things\nSo fixed and quick to burst into blame \nAt any loss of control, without sense of self\nIt shrouds and distills; it stings and it welts\nThough all our plans were dense with trees\nI discerned only leaves that were brittle and creased\nAs I just lied awake overthinking things\nLife still went on with or without\n\nFrameworks is Luke Pate, Cory Fischer, Andy Nicholl, Ryan McDonald, and Matt Horner\n\nSmall Victories was recorded, mixed, and mastered by Matt McClellan at Glow In The Dark Studios in Atlanta, Georgia\n\nTrumpet by Alec Prorock\n\n\nfor fans of: touche amore, pianos become the teeth, code orange kids, defeater, the saddest landscape, caravels, explosions in the sky, circle takes the square', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/nW-TuSE_L4k" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=nW-TuSE_L4k', 'screamoFrameworksold chokessmall victoriesla disputetouche amoremake do and menddefeater13th floor recordsmusic videoLa Dispute (band)rise recordsno sleep recordsrun for cover recordstopshelf recordsyou blew itdikembeconvergepianos become the teethcode or', '2016-06-05', '2016-06-05'),
