(218, 'Recommended Tools for the Salvage Yard', 'cYLUEhTt30U', '**Sponsored Video**I''ve put together this list of recommended tools to bring when you go to the salvage yard. A lot of it is just basic hand tools, but I do have some other recommendations like water and sunscreen. I highly recommend both of those so you don''t end up dehydrated and slightly crispy like I did. \n\nIf you''re not familiar with Pull-A-Part, they''re a self service salvage company in the US. They have 25 yards in 12 states. I''m not just saying this, but they''ve become my favorite place to go for salvage parts. I suggest you check them out. \n\nTo make it easy, here''s a link to their website: http://www.pullapart.com\n\nThe best place for answers to your automotive questions:  http://www.ericthecarguy.com\n\nCamera: Erik Tande\n\nThanks for watching!\n\nDiscussion about this video: http://www.ericthecarguy.com/kunena/18-The-EricTheCarGuy-Video-Forum/64148-recommended-tools-for-the-salvage-yard\n\n**Answers to your automotive questions found here: http://www.ericthecarguy.com/faq\n\nRelated Videos\n\nCheck Out Pull-a-Part!: https://www.youtube.com/watch?v=g8sDU2N2AQU\n\nDon''t Be a Selfish Tool!: https://www.youtube.com/watch?v=waVeB6mzQP4\n\nWhat To Look for in a Salvage Engine or Transmission:\n\nSalvage Yard Hack: How To Get Power in the Yard:\n\nSalvage Yard Pulls Playlist:\n\n**Answers to your automotive questions found here: http://www.ericthecarguy.com/faq\n\nSocial Network Links\n\nFacebook:  https://www.facebook.com/EricTheCarGuy?fref=ts\n\nTwitter:  https://twitter.com/EricTheCarGuy\n\nGoogle+:  https://plus.google.com/100195180196698058780/posts\n\nInstagram: http://instagram.com/ericthecarguy\n\nInformation on Premium Membership:  https://www.ericthecarguy.com/premium-content-streaming-etcg-content\n\nStay Dirty\n\nETCG\n\nDue to factors beyond the control of EricTheCarGuy, it cannot guarantee against unauthorized modifications of this information, or improper use of this information.  EricTheCarGuy assumes no liability for property damage or injury incurred as a result of any of the information contained in this video. EricTheCarGuy recommends safe practices when working with power tools, automotive lifts, lifting tools, jack stands, electrical equipment, blunt instruments, chemicals, lubricants, or any other tools or equipment seen or implied in this video.  Due to factors beyond the control of EricTheCarGuy, no information contained in this video shall create any express or implied warranty or guarantee of any particular result.  Any injury, damage or loss that may result from improper use of these tools, equipment, or the information contained in this video is the sole responsibility of the user and not EricTheCarGuy.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/cYLUEhTt30U" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=cYLUEhTt30U', 'Custom Maprecommended tools for the salvage yardtools to bring to the junk yardjunk yard toolstools to bring to the breakersrecommended toolspull-a-partpull-a-part pull-a-part salvage partspull-a-part affordable salvage partsETCG goes to pull-a-partEric t', '2016-06-05', '2016-06-05'),
