(227, 'What is machine learning?', 'WXHM_i-fgGo', 'The goals of AI is to create a machine which can mimic a human mind and to do that it needs learning capabilities. But how does machine learning work? Read the article on AndroidAuthority.com: http://goo.gl/1tjJZb\n\n\nTalk about Android in our forums: http://www.androidauthority.com/community\n\nSubscribe to our YouTube channel: http://www.youtube.com/subscription_center?add_user=androidauthority\n----------------------------------------------------\nStay connected to Android Authority:\n- http://www.androidauthority.com\n- http://google.com/+androidauthority\n- http://facebook.com/androidauthority/\n- http://twitter.com/androidauth/\n- http://instagram.com/androidauthority/\n\nFollow the Team:\nJosh Vergara: https://plus.google.com/+JoshuaVergara\nJoe Hindy: https://plus.google.com/+JosephHindy\nLanh Nguyen: https://plus.google.com/+LanhNguyenFilms\nJayce Broda: https://plus.google.com/+JayceBroda\nGary Sims: https://plus.google.com/+GarySims\nAsh Tailor: https://plus.google.com/+AshTailor', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/WXHM_i-fgGo" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=WXHM_i-fgGo', 'machine_learningAndroidAuthorityAndroidArtificial Intelligence (Industry)Machine Learning (Software Genre)', '2016-06-05', '2016-06-05'),
(228, 'Hello World - Machine Learning Recipes #1', 'cKxRvEZd3Mw', 'Six lines of Python is all it takes to write your first machine learning program! In this episode, we''ll briefly introduce what machine learning is and why it''s important. Then, we''ll follow a recipe for supervised learning (a technique to create a classifier from examples) and code it up.\n\nFollow https://twitter.com/random_forests for updates on new episodes!\n\nSubscribe to the Google Developers: http://goo.gl/mQyv5L', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/cKxRvEZd3Mw" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=cKxRvEZd3Mw', 'Machine Learning (Software Genre)GoogledevelopersMachine LearningMachine Learning RecipesHello Worldproduct: webfullname: otherLocation: NYCTeam: Scalable AdvocacyType: OtherGDS: Full ProductionOther: NoGreenScreen', '2016-06-05', '2016-06-05'),
(229, 'Machine Learning: Google''s Vision - Google I/O 2016', 'Rnm83GqgqPE', 'Google has deployed practical A.I. throughout its products for the last decade -- from Translate, to the Google app, to Photos, to Inbox. The teams continue to make fundamental breakthroughs in machine learning, publishing promising new results at an accelerating pace. Now TensorFlow and Cloud Machine Learning make it even easier for researchers and developers around the world to collaborate. So as we work together to drive machine learning forward, what are the most exciting possibilities? What are the top challenges? And what''s on the horizon? Join Google''s machine learning leads in a discussion with veteran technology editor Tom Simonite as we explore the promise of machine learning.\n\nSee all the talks from Google I/O 2016 here: https://goo.gl/olw6kV\nWatch more Android talks at I/O 2016 here: https://goo.gl/Uv3jls\nWatch more Chrome talks at I/O 2016 here: https://goo.gl/JoMLpB\nWatch more Firebase talks at I/O 2016 here: https://goo.gl/JTH9Fr \nSubscribe to the Google Developers Channel: http://goo.gl/mQyv5L \n\n#io16 #GoogleIO #GoogleIO2016', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/Rnm83GqgqPE" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=Rnm83GqgqPE', 'Other: NoGreenScreenGoogledevelopersproduct: IOTLocation: MTVTeam: Scalable AdvocacyType: Live EventGDS: Full ProductionOther: NoGreenScreengoogle IOIOmachine learning', '2016-06-05', '2016-06-05'),
(230, 'Lecture 1 | Machine Learning (Stanford)', 'UzxYlbK2c7E', 'Lecture by Professor Andrew Ng for Machine Learning (CS 229) in the Stanford Computer Science department.  Professor Ng provides an overview of the course in this introductory meeting. \r\n\r\nThis course provides a broad introduction to machine learning and statistical pattern recognition. Topics include supervised learning, unsupervised learning, learning theory, reinforcement learning and adaptive control.   Recent applications of machine learning, such as to robotic control, data mining, autonomous navigation, bioinformatics, speech recognition, and text and web data processing are also discussed.\r\n\r\nComplete Playlist for the Course:\r\nhttp://www.youtube.com/view_play_list?p=A89DCFA6ADACE599\r\n\r\nCS 229 Course Website:\r\nhttp://www.stanford.edu/class/cs229/\r\n\r\nStanford University:\r\nhttp://www.stanford.edu/\r\n\r\nStanford University Channel on YouTube:\r\nhttp://www.youtube.com/stanford', 0, '<iframe width="480" height="360" src="//www.youtube.com/embed/UzxYlbK2c7E" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=UzxYlbK2c7E', 'machine learningsciencemathengineeringcomputertechnologyroboticsreinforcementsupervisedlearningalgorithmmachineimageprocessingICAtheoryprogrammingcode', '2016-06-05', '2016-06-05'),
(231, 'Machine Learning Methods - Computerphile', 'qDbpYUbf3e0', 'We haven''t got time to label things, so can we let the computers work it out for themselves? Professor Uwe Aickelin explains supervised and un-supervised methods of machine learning.\n\nSilicon Brain: 1,000,000 ARM Cores: https://youtu.be/2e06C-yUwlc \nBrian Kerninghan on Bell Labs: https://youtu.be/QFK6RG47bww\nCould We Ban Encryption?: https://youtu.be/ShUyfk4QB-8 \nComputer That Changed Everything - Altair 8800: https://youtu.be/6LYRgrqJgDc\n\nhttp://www.facebook.com/computerphile\nhttps://twitter.com/computer_phile\n\nThis video was filmed and edited by Sean Riley.\n\nComputer Science at the University of Nottingham: http://bit.ly/nottscomputer\n\nComputerphile is a sister project to Brady Haran''s Numberphile. More at http://www.bradyharan.com', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/qDbpYUbf3e0" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=qDbpYUbf3e0', 'codecomputerscomputerphilecomputer sciencedata miningmachine learningsupervised machine learningunsupervised machine learningComputer', '2016-06-05', '2016-06-05'),
(232, 'A Gentle Introduction To Machine Learning; SciPy 2013 Presentation', 'NOm1zA_Cats', 'Authors: Kastner, Kyle, Southwest Research Institute\n\nTrack: Machine Learning\n\nThis talk will be an introduction to the root concepts of machine learning, starting with simple statistics, then working into parameter estimation, regression, model estimation, and basic classification. These are the underpinnings of many techniques in machine learning, though it is often difficult to find a clear and concise explanation of these basic methods.\n\nParameter estimation will cover Gaussian parameter estimation of the following types: known variance, unknown mean; known mean, unknown variance; and unknown mean, unknown variance.\n\nRegression will cover linear regression, linear regression using alternate basis functions, bayesian linear regression, and bayesian linear regression with model selection.\n\nClassification will extend the topic of regression, exploring k-means clustering, linear discriminants, logistic regression, and support vector machines, with some discussion of relevance vector machines for "soft" decision making.\n\nStarting from simple statistics and working upward, I hope to provide a clear grounding of how basic machine learning works mathematically. Understanding the math behind parameter estimation, regression, and classification will help individuals gain an understanding of the more complicated methods in machine learning. This should help demystify some of the modern approaches to machine learning, leading to better technique selection in real-world applications.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/NOm1zA_Cats" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=NOm1zA_Cats', 'Computerscipy2013scipypython (software)', '2016-06-05', '2016-06-05'),
(233, 'Architecting Predictive Algorithms for Machine Learning', 'KoQdAdxjnoU', 'Machine learning is one of the newest tools in a Data Scientist’s arsenal. In this session, you will learn key architectural principles and frameworks for creating practical approaches to solving the prediction problem. Interactive demonstration of various popular machine learning algorithms based on these principles and frameworks will be included.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/KoQdAdxjnoU" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=KoQdAdxjnoU', 'python (software)MicrosoftTechEd Europe 2014Machine LearningSeth Juarez', '2016-06-05', '2016-06-05'),
(234, 'Machine Learning:  The Basics, with Ron Bekkerman', 'wjTJVhmu1JM', ' ', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/wjTJVhmu1JM" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=wjTJVhmu1JM', 'Seth JuarezMachineLearninglinkedintechtalks', '2016-06-05', '2016-06-05'),
(235, 'Visualizing a Decision Tree - Machine Learning Recipes #2', 'tNa99PG8hR8', 'Last episode, we treated our Decision Tree as a blackbox. In this episode, we''ll build one on a real dataset, add code to visualize it, and practice reading it - so you can see how it works under the hood. And hey -- I may have gone a little fast through some parts. Just let me know, I''ll slow down. Also: we''ll do a Q&A episode down the road, so if anything is unclear, just ask!\n\nFollow https://twitter.com/random_forests for updates on new episodes!\n\nSubscribe to the Google Developers: http://goo.gl/mQyv5L', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/tNa99PG8hR8" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=tNa99PG8hR8', 'techtalksGoogledevelopersMachine LearningMachine Learning RecipesHello Worldproduct: webfullname: otherLocation: NYCTeam: Scalable AdvocacyType: OtherGDS: Full ProductionOther: NoGreenScreen', '2016-06-05', '2016-06-05'),
(236, 'Machine Learning & Deep Neural Networks Explained - #NatAndLo 7', 'bHvf7Tagt18', 'SUBSCRIBE: https://goo.gl/CEsJyN \nFOLLOW US: https://twitter.com/NatAndLo\nTWEET THIS: http://ctt.ec/6jtD1\n\nWhat do voice search, machine translation, and ATMs have in common? Learn the answer to that question and more in this week’s episode.\n\n*Greg and Chris did an AMA on Friday, September 25th to answer people''s deep learning questions. Check out their answers here: https://goo.gl/jpbMy9\n\n*To read more about machine learning, neural nets, and the like – check out the Google Research blog: http://googleresearch.blogspot.com/ and Chris''s blog: http://colah.github.io/\n\n*And here’s the documentary that we worked on about how voice search works: https://www.youtube.com/watch?v=yxxRAHVtafI\n\nThanks to our friend Vibe Mountain for the excellent music in this episode.\n\nAnd thanks to our friend Beardy Glasses (http://beardyglasses.com/) for the excellent illustrations!\n\nScreenshot of coding at 1:02 credit: Alec Radford, Head of Research at indico Data Solutions (indico.io). "Introduction to Deep Learning with Python".  youtube: https://www.youtube.com/watch?v=S75EdAcXHKk | slideshare: http://slidesha.re/1zs9M11 \n\n:)\nNat & Lo''s 20% Project\nhttp://youtube.com/natandlo -- a show about all the stuff we''re curious about at Google.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/bHvf7Tagt18" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=bHvf7Tagt18', 'Other: NoGreenScreengooglenat and lonat and lo''s 20% projectnat and lo''s 20 percent projectnat & lonat+lonat & lo''s 20% project20% project20 percent projectbehind the scenesmachine learningdeep learningartificial neural networksArtificial Intelligence (In', '2016-06-05', '2016-06-05'),
(237, 'Database Lesson #1 of 8 - Introduction to Databases', '4Z9KEBexzcM', 'Dr. Soper gives an introductory lecture on database technologies. Topics covered include the reasons for using a database, the components of a database system, the elements of a database, the purpose of database management systems (DBMS), and the functions of a database application.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/4Z9KEBexzcM" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=4Z9KEBexzcM', 'data_basesdatabasedatabasesDBMS', '2016-06-05', '2016-06-05'),
