(250, 'The Art of Stress-Free Productivity: David Allen at TEDxClaremontColleges', 'CHxhjDPKfbY', 'Productivity guru and coach David Allen talks about "Stress Free Productivity" at TEDxClaremontColleges.\n\nAbout TEDx:\nIn the spirit of ideas worth spreading, TEDx is a program of local, self-organized events that bring people together to share a TED-like experience. At a TEDx event, TEDTalks video and live speakers combine to spark deep discussion and connection in a small group. These local, self-organized events are branded TEDx, where x = independently organized TED event. The TED Conference provides general guidance for the TEDx program, but individual TEDx events are self-organized\n\nCredits:\nEditor -- Jacqueline Legazcue\nCamera crew -- Jacqueline Legazcue, Sam Jones, and Ted Neckar', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/CHxhjDPKfbY" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=CHxhjDPKfbY', 'productivityBusinessProductivitytedx talksted talkLifestyletedtedx talkted talkstedxted xHealthEnglishUnited StatesTEDxClaremontColleges', '2016-06-05', '2016-06-05'),
