(252, 'The Science of Productivity', 'lHfjvYzr-3g', 'Made in collaboration with Sparring Mind, the behavioral psychology blog. Read the full productivity post: http://bit.ly/XRcYAY\n\nTWEET IT - http://clicktotweet.com/ny8ak\n\nIn today''s crazy world, productivity is on the minds of many. So what can science tell us about the human brain and productive work? How do we become more efficient at working, and spend less time working overall? \n\nWritten and created by Mitchell Moffit (twitter @mitchellmoffit) and Gregory Brown (twitter @whalewatchmeplz).\n\nTWITTER: http://www.twitter.com/AsapSCIENCE\nFACEBOOK: http://www.facebook.com/AsapSCIENCE\n\nMitchell Moffit\nhttp://www.mitchellmoffit.com\nhttp://www.twitter.com/mitchellmoffit\nhttp://www.facebook.com/mitchellmoffit\n\nGregory\nhttp://www.gregorybrownart.tumblr.com\nhttp://www.twitter.com/whalewatchmeplz\n\nSOURCES----\n\nFear of projects:\n1) http://bit.ly/TX4DJr\n \nZeigarnik Effect:\n2) http://bit.ly/XWOCG0\n\nSimulated Work:\n3) http://bit.ly/W8y21M\n\nEgo Depletion\n4) http://bit.ly/12n7uNI\n\nPractice (Elite Violinists):\n5) http://bit.ly/QWLtCK\n6) http://bit.ly/Z2DgBT\n7) http://1.usa.gov/UDE6OJ\n\nMultitasking:\n8) http://bit.ly/UmTVIv', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/lHfjvYzr-3g" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=lHfjvYzr-3g', 'monotaskingScienceAsapAsapSCIENCEProductivityBrainWorkBusinessTimeManagementEfficientMarketingTime ManagementMindProductiveWillpowerEgo DepletionBarrierTrainingControlSuccessTutorialMusicWritingPracticeTaskScheduleHabitBreakEnergyDeadlineMultitaskMultitas', '2016-06-05', '2016-06-05'),
(253, 'Concentration Productivity Music. 45 minutes of focus music: Study, concentration. Improve work', 'CB_PZSnen5A', 'Concentration Productivity Music - RelaxingRecords are experts in creating study music, concentration music, studying music, relaxing music, brain enhancing music, reading music and learning music and focus music. Our music is composed in-house by our team of producers, and uses binaural beats (delta waves, alpha waves and theta waves) to put you in a relaxed state of mind. We create healing music, incorporating Tibetan Music, Spa and Massage Music, Yoga Music and Reiki Music within our playlists, to encourage a natural state of relaxation.\n\n\n??? Relaxing Concentration Study Music on iTunes: \n\nStudy and Meditation Music??? https://itunes.apple.com/gb/artist/relaxingrecords/id432609670\n\nStudy Focus Concentration Playlist \n\n ? ? https://goo.gl/eKCRbt\n\n\nOur Study Music Playlist is inspired by the work of Mozart, Beethoven, Chopin and Bach to make your homework easier. \n\n\n? ? ? http://relaxingrecords.com\n\nOur playlists use calming music, including white noise, nature sounds and pictures to relax your mind and aid you in concentration, meditation and relaxation.\n\n? Sleep Music / Sleeping Music: https://goo.gl/HDJEZw\n\n\nOur Sleep Music is designed to aid deep sleep, and we have been helping people with sleeping problems like insomnia for over five years. Whether you are a mother wanting to use baby sleep music, a teenager suffering from ADHD, an adult suffering from work stress or a senior having trouble getting a good night’s sleep - our channel will provide relaxation music to battle these issues.\n\nOur dreamy landscape pictures combined with classical instrumental music moves your body and mind into a state of relaxation and concentration. \n\n? Relaxing / Relaxation, Meditation, Healing and Stress Relief Music: https://goo.gl/mQiiEN\n\n\nThe music created for our RelaxingRecords channel uses inspiration from a range of different meditation styles, including Deekpak Chopra Meditation, Russell Simmons Meditation, Buddhist meditation, Zen meditation, mindfulness meditation and Eckhart Tolle meditation. \n\nThese types of meditation music combined work perfectly to help all types of people experience deep meditation. We aim to clear the mind and open the third eye - taking inspiration from Tibetan Music, Japanese meditation music and Indian meditation music. \n\n? ? Concentration and Study Music to help Focus : https://goo.gl/eKCRbt\n\nStudying for exams or working towards deadlines is a stressful time for everyone - and our Study and Concentration music will help you to focus on achieving your goals whether work or education based. \n\nBy combining a range of different music genres, from classical to house, and incorporating our popular nature sounds - we have a variety of study music to engage your mind.\n\nOur Exam Music will help you with your revision, term papers or assignments. Designed to increase brain power and improve memory by learning through music and keeping you focused. Our Music can also be used in the office to increase brain memory retention by using our study playlist you can improve memory. \n\nPeople also use our us for reading music or just soothing music to help focus on learning so you could say we have a set of good study songs. \n\nWhether it’s term papers, coursework or assignments you are struggling to study for, our Study Music will help you to concentrate and increase your focus. In the past we have helped people studying for various exams, including A Levels, AQA, GCSE, SAT, ACT, GRE. Our study playlists also help students concentrate on other exams such as ISEE, ACCA, MAT, GED, GAT, NEST and TUS\n\nBy combining a range of different music genres, from classical to house, and incorporating our popular nature sounds - we have a variety of study music to engage your mind. You will also find some Study Music Jazz and a classical Music Mix. You can use it whilst reading music, studying, working or writing to increase your focus and concentration. Our Music helps with problem-solving and study skills and intellectual endurance to help you do the best on your exams. \n\n? Relaxing Massage and Spa Music: \n\nLong day at work? In need of a little indulgence? Look no further than the RelaxingRecords channel, encouraging the ultimate in relaxation by combining instrumental music with light nature sounds and stunning piano melodies to help you enter a state of true relaxation.\n\n? Yoga Music: \n\n\nOur Yoga music is inspired by composed so that whether you are a beginner or expert, it will help you into complete focus for your session. Our music takes inspiration from African and Indian yoga music and chants.\n\nAt RelaxingRecords would Love to talk with you about anything :-D \n \nJoin Our Relaxing Records Community and lets all Talk \n\n? Facebook : https://www.facebook.com/RelaxingRecords/\n? Google+ : https://plus.google.com/+relaxingrecords\n? Twitter: https://twitter.com/relaxingrecords\n? Instagram: https://www.instagram.com/relaxingrecords/', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/CB_PZSnen5A" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=CB_PZSnen5A', 'Increasemeditation musicstudy musicbackground musicinstrumental musicmusic therapytranquil musicclassical music playlistfocus musicfocusing musiclearning musicbrain power musiccalm music for studyingnature soundsmusic to study and concentrateconcentration', '2016-06-05', '2016-06-05'),
(254, 'The 4-Minute Trick For Massive Productivity', 'dOWxLxVkTpw', 'Want to be massively productive? This 4-minute trick will change the way you work so you can get more done with less stress and overwhelm.\n\nC''mon over to http://www.marieforleo.com/2015/07/massively-productive/ where the main discussion happens after the episode!\n\nMissed my most recent episodes? Watch them here:\nhttp://www.marieforleo.com/2015/07/promote-proudly/\nhttp://www.marieforleo.com/2015/06/toughen-up/\n\nIf you enjoyed this video, subscribe to our channel and sign up for your free weekly business and life advice at http://www.marieforleo.com.\n\nAnd if you’re interested in more episodes on how to focus and be productive, check out our YouTube playlist on that exact topic here: https://www.youtube.com/playlist?list=PL4FE61E9B84760E4A.\n\nThanks for watching!\n\nMy YouTube channel: http://www.youtube.com/marieforleo\nProductivity on my website: http://www.marieforleo.com/2015/07/massively-productive/\nProductivity on YouTube: http://youtu.be/dOWxLxVkTpw', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/dOWxLxVkTpw" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=dOWxLxVkTpw', 'focusProductivityTime ManagementBe More ProductiveGet More DoneSmall BusinessMarie ForleoHow to Start an Online BusinessMotivationHow to Start a BusinessMarketingBusiness IdeasPersonal DevelopmentSelf-HelpPersonal Growth', '2016-06-05', '2016-06-05'),
