(270, 'Home Security Life Hacks', 'lc7-0ZxXgJw', 'A burglary occurs every 15 seconds, are you protected? Use these Life Hacks to sleep easier and protect your home… and maybe have a little fun in the process.\nCheck out SmartThings https://www.smartthings.com/householdhacker\nWe''ve put together an amazing set of Life Hacks to level up your home security. And if you are interested in remote monitoring and home automation we’ve got that covered too. Feel free to leave your own security life hacks in the comments and share this video with your friends and family to keep them safe!\n\nA huge thanks to our sponsor, SmartThings. Check out the link above to learn more and get your own kit.\n\nFollow us on Facebook and twitter:\nhttp://facebook.com/HackThePlanet\nhttp://twitter.com/HouseholdHacker\nSubscribe for your dose of Life Hackery and Macgyver style solutions!\n\n-~-~~-~~~-~~-~-\nSpring/Summer Tip Videos:\n7 Genius Ways to Get Rid of Ants: https://www.youtube.com/watch?v=cWyWnA3GojI\nHOW TO Make the ULTIMATE Mosquito Repellent: https://www.youtube.com/watch?v=rg4LEiLdeJg\n-~-~~-~~~-~~-~-', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/lc7-0ZxXgJw" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=lc7-0ZxXgJw', 'securityHouseholdhackerhousehold hackerhousehold hackersdiyhow tohowtolife hacklife hackslife hackingmakelife hacks for kidssmarthomeconnected homehome securityhome monitoringandroidzwavehome automation diyhome automation using androidhome automation syst', '2016-06-05', '2016-06-05'),
(271, 'Hillary Clinton FULL Speech On National Security. Trump ‘temperamentally unfit’ for White House', 'y04TVy0FxHg', 'Hillary Clinton National Security Policy Address Democratic presidential candidate Hillary Clinton spoke in San Diego, California. Hillary Clinton warned on Thursday that a Donald Trump presidency would lead the U.S. to become more “fearful” and imperiled on the world stage. “Donald Trump’s ideas aren’t just different; they are dangerously incoherent,” Clinton said in a speech in San Diego on Thursday. Hillary Clinton wasted no time in tearing into Donald Trump during her big foreign policy address today, calling him “temperamentally unfit” for someone who wants to oversee matters of life and death. “Donald Trump’s ideas aren’t just different,” Clinton said, “they are dangerously incoherent. They’re not even really ideas, just a series of bizarre rants, personal feuds, and outright lies.” She played up what a unique risk Trump would be to America’s security as she warned that Trump could very well lead America into a war because some foreign leader “got under his very thin skin.” Parts of Clinton’s attacks got some laughs––like when she invoked Trump’s quote about his “very good brain” or mentioned Miss America––but she made it clear how seriously alarmed she is about Trump’s braggadocious nature, combined with his willingness to insult America’s allies with abandon. She said if Trump honestly believes America is weak, “you don’t know America and you certainly don’t deserve to lead it.” Watch above, via CNN. “They aren’t even really ideas, just a series of bizarre rants, personal feuds and outright lies.” “He is not just unprepared — he is temperamentally unfit to hold an office that requires knowledge, stability and immense responsibility,” the Democratic front-runner said. The comments are the most direct attacks on Trump’s lack of foreign policy experience since the New York billionaire became the presumptive GOP nominee. ?She laid out her national security vision for keeping Americans safe at home and continuing to play a leading role on the world stage.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/y04TVy0FxHg" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=y04TVy0FxHg', 'zigbeehillary clinton national security speechhillary clintonnational securityspeechhillaryclintonnationalsecurityhillary clinton national security addresshillary clinton trump national security speechhillary clinton donald trump national security speechh', '2016-06-05', '2016-06-05'),
(272, 'Hillary Clinton National Security Address - FULL SPEECH (C-SPAN)', 'wpX0YAbhtvY', 'Hillary Clinton: "He is not just unprepared; he is temperamentally unfit to hold an office that requires knowledge, stability and immense responsibility. This is not someone who should ever have the nuclear codes because it''s not hard to imagine Donald Trump leading us into a war just because somebody got under his very thin skin." Watch full speech here: http://cs.pn/1TY4Glz', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/wpX0YAbhtvY" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=wpX0YAbhtvY', 'hillary clinton trump national securityHillary ClintonDonald TrumpNational SecurityWhite HousePoliticsC-SPANCSPAN', '2016-06-05', '2016-06-05'),
