(275, 'America''s Maximum Security Prisons | Full Documentary HD', '8ogPpQx_h-k', 'Prison Documentaries\n\n"Lockdown" plunges viewers headfirst into life in the "big house," the gritty underworld of America''s maximum-security prisons, where gangs are prevalent, predators stalk their next prey and inmates are armed with deadly weapons. But prison officials have their own weapons in the form of modern surveillance and old-time isolation -- plus steel batons and pepper spray -- to help keep the peace in these miniature war zones.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/8ogPpQx_h-k" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=8ogPpQx_h-k', 'minecraft securityPrison DocumentariesAmerica''s Hardest Prisons: Gang WarsGang WarsAmerica''s Hardest PrisonsLockdownAmerica''s maximum-security prisonsamerican prisonamerican prisonersMaximum-Security PrisonsMaximum Security Prisons | Full Documentary HD', '2016-06-05', '2016-06-05'),
(276, 'Dangerously Rich Billionaire Super Security 2012 (Part 1/2)', 'HquUL5twUQA', 'From Warren Buffett''s bodyguard to a high-tech panic room in a Hollywood mansion and on board a mega yacht in Miami, CNBC goes behind the scenes with the men and women who protect the super-rich. These are nervous times for billionaires around the globe and an entire industry is on call ready to sell the ultra-rich super security.\n\nAll rights to the original owner.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/HquUL5twUQA" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=HquUL5twUQA', 'Maximum Security Prisons | Full Documentary HDbodyguardRichPoliceCopsCrimeSecurity (Quotation Subject)CourtPoorAttorneyLawyer (Profession)201120122013drugstraffickingdeatargetwire tapcoke moneycartelelitebusiness - organisationmoney launderingsearch warre', '2016-06-05', '2016-06-05'),
(277, 'Johnny Depp & Amber Heard - Security Guards Testimony', 'lxsRp6VoGtE', 'Johnny Depp and Amber Heard’s divorce took an unexpected turn after Heard alleged that she had been assaulted by Depp.  Depp’s security guards were on site during the time of the alleged assault, but since they are on Depp’s payroll, how useful will their testimony be? We look into the allegations further with child protection and national security consultant Francey Hakes in this Crime Time highlight hosted by Allison Hope Weiner. \n\nWatch the full episode here:\nhttps://www.youtube.com/watch?v=uLf82la3iY0&index=1&list=PLjk3H0GXhhGfIvJXM3emqDXkZ02SXgfgT\n\nMore Crime Time shorts here:\nhttps://www.youtube.com/watch?v=dfjGW4wMRYE&index=1&list=PLjk3H0GXhhGdjFjMrl3rrU9TokQSzrUo9\n\nCrime Time Full Episodes Playlist:\nhttps://www.youtube.com/watch?v=uLf82la3iY0&index=1&list=PLjk3H0GXhhGfIvJXM3emqDXkZ02SXgfgT\n\nhttps://www.facebook.com/CrimeTimeWithAllisonHopeWeiner?ref=hl\n\nhttps://www.facebook.com/thelip.tv', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/lxsRp6VoGtE" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=lxsRp6VoGtE', 'ArcticJohnny Depp Amber HeardJohnny Depp security guardsJohnny Depp bodyguardsJohnny Depp bodyguards testimonyJohnny Depp spousal abuseJohnny Depp divorceJohnny Depp abuseAmber Heard restraining orderAmber Heard testimonyAmber Heard abusespousal abuseJohn', '2016-06-05', '2016-06-05');
