(278, 'The New Fiver - Key Security Features', '1kOF6p21BzE', 'The Bank of England’s first polymer £5 note will be issued from 13 September 2016. This video introduces The New Fiver’s advanced security features, which make it harder to counterfeit than paper notes. They include a see-through window with a portrait of the Queen, and a detailed foil picture of the Elizabeth Tower (Big Ben) which is gold on the front of the note and silver on the back.\n\nFind out more about #TheNewFiver: http://www.thenewfiver.co.uk\n\nSee how The New Fiver is made: https://www.youtube.com/watch?v=eRbKkfkAH2s', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/1kOF6p21BzE" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=1kOF6p21BzE', 'thelipBank of EnglandThe New FiverPolymer£5 noteSir Winston ChurchillSecurity FeaturesSaferStrongerCleaner', '2016-06-05', '2016-06-05'),
