(287, 'Robotic Automation for Industrial Processes', 'fgExvIUYg5w', 'A quick-hitting Weldon Solutions video showing a wide variety of industrial automation solutions using FANUC robots. See unique machine tending, palletizing, material removal, spot welding and more.\n\nWeldon Solutions is an Authorized System Integrator for FANUC Robotics, North America''s leading supplier of robotic automation. Weldon is also a FANUC Vision System Integrator, providing the ultimate in automation versatility. We offer a wide range of cost-effective and flexible robotic solutions to meet a variety of industrial automation needs. FANUC high performance robots, coupled with our project management, innovative systems engineering, customer service, and extensive industry experience have enabled us to successfully automate a variety of applications across several industries.', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/fgExvIUYg5w" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=fgExvIUYg5w', 'HatchWeldonAutomation (Industry)Robotics (Industry)weldon solutionsweldon automationweldon robotics', '2016-06-05', '2016-06-05'),
