(296, 'Testing the NEW Bowflex 560 Smart Dumbbells!', '-3iZVdsMCuI', 'CHECK OUT 560 DUMBBELLS  ????\nhttp://goo.gl/iNefzU\n\n\n\nMy buddies and I test review Bowflex 560 Dumbbells, which are ''Smart Dumbbells'' with the ability to track reps, sets, poundage, and progress over time. If you''re looking for the best home gym equipment or just good dumbbells you should look into these for sure. These are great dumbbells for the home gym or the smaller studio because they are adjustable and they have some clever smart features. \n\n\n\n\n? CONNECT ?\nSubscribe: http://goo.gl/aTyGpN\n\n\nhttps://twitter.com/rizknows\nhttp://instagram.com/rizknows\nhttps://www.facebook.com/rizknows\nSnapchat: rizardofoz\nPeriscope: rizknows\n\n\nWebsite: http://rizknows.com\nDeals! http://rizknows.com/deals\nMy Favorite Gear: http://goo.gl/PwNWE9\nEmail: jeff [at] rizknows [dot] com\n\n\nCreator: Jeff Rizzo\nChannel: RizKnows\nSend me stuff: 1860 Sierra Gardens Drive #783, Roseville, CA 95661\n\n\n\n\n\nRizKnows Caricatures\nhttp://thinkbuilddestroy.com\n\nSong: "Ever Felt Pt. 1" (by Otis McDonald)', 0, '<iframe width="640" height="360" src="//www.youtube.com/embed/-3iZVdsMCuI" frameborder="0" allowfullscreen></iframe>', 0, 0, 'https://www.youtube.com/watch?v=-3iZVdsMCuI', 'guidebowflexbowflex 560 dumbbells560 dumbbellsdumbbell reviewbest dumbbellsbest home gym equipmentbest home dumbbellsbest equipment for home gymhome gym560 dumbbells reviewbowflex smart dumbbells', '2016-06-05', '2016-06-05'),
